export const altaMedicoRequest = (data , setMedicoData) => {

    const options = {
        method: "POST",
        body: JSON.stringify(data),
        headers: {
            "Content-Type" : "application/json"
        }
    }

    fetch('https://localhost:8080/users/altaMedico', options)
        .then(res =>{ 
            console.log(res)
            setMedicoData(res)
            res.json()})
        .then(res => {

            console.log(res)});


}
